import React from 'react';

import './flight-item.css';

export default ({ id, ...props }) => {
  return (
    <tr>
      <td>{props.event}</td>
      <td>{props.time}</td>
      <td>{props.direction}</td>
      <td>{props.flight}</td>
      <td>{props.carrier}</td>
      <td>{props.vehicle}</td>
      <td>{props.days}</td>
    </tr>
  );
};
